import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { ServidoresRoutingModule } from './servidores-routing.module';
import { MainServidoresComponent } from '../servidores/components/main-servidores/main-servidores.component';
import { WebSphereComponent } from '../servidores/components/WebSphere/web-sphere.component';
import { WebLogicComponent } from '../servidores/components/WebLogic/web-logic.component';
import { TomcatComponent } from '../servidores/components/tomcat/tomcat.component';
import { WildflyComponent } from '../servidores/components/wildfly/wildfly.component';
import { Db2Component } from '../servidores/components/db2/db2.component';
import { IisComponent } from '../servidores/components/iis/iis.component';

@NgModule({
  declarations: [
    MainServidoresComponent,
    WebSphereComponent,
    WebLogicComponent,
    TomcatComponent,
    WildflyComponent,
    Db2Component,
    IisComponent
  ],
  imports: [
    CommonModule,
    ServidoresRoutingModule
  ]
})
export class ServidoresModule { }
